import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Raw() {
    const [tempList, setTempList] = useState([]);

    useEffect(() => {
        fetchData();
    }, []);

    const fetchData = async () => {
        try {
            const response = await axios.get('https://engineering-task.elancoapps.com/api/raw');
            setTempList(response.data);
        } catch (e) {
            console.log('Error:', e);
        }
    };

    const ascendingEvent = () => {
        let data = [...tempList];
        if (data.length > 0) {
            let result = data.sort((a, b) => a.name.localeCompare(b.name));
            setTempList(result);
        }
    };

    const descendingEvent = () => {
        let data = [...tempList];
        if (data.length > 0) {
            let result = data.sort((a, b) => b.name.localeCompare(a.name));
            setTempList(result);
        }
    };

    return (
        <div>
            <div style={{ marginTop: '20px' }}>
                <button onClick={ascendingEvent}>Ascending</button>
                <button style={{ margin: '10px' }} onClick={descendingEvent}>
                    Descending
                </button>
                <button onClick={fetchData}>Get Data</button>
            </div>
            <div className="App" style={{ textAlign: 'left', width: '50%', margin: '10px auto' }}>
                {tempList && tempList.length > 0 ? (
                    tempList.map((item, i) => {
                        return <div key={i}>{item.name}</div>;
                    })
                ) : (
                    <div>No Data</div>
                )}
            </div>
        </div>
    );


}

export default Raw;




